--

CREATE FUNCTION app.retotal_on_item_change() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
  v_delta NUMERIC(14,2);
BEGIN
  IF TG_OP = 'INSERT' THEN
    v_delta := NEW.qty * NEW.unit_price;
    UPDATE app.orders
      SET total_amount = total_amount + v_delta
    WHERE order_id = NEW.order_id;

  ELSIF TG_OP = 'UPDATE' THEN
    v_delta := (NEW.qty * NEW.unit_price) - (OLD.qty * OLD.unit_price);
    UPDATE app.orders
      SET total_amount = total_amount + v_delta
    WHERE order_id = NEW.order_id;

  ELSIF TG_OP = 'DELETE' THEN
    v_delta := OLD.qty * OLD.unit_price;
    UPDATE app.orders
      SET total_amount = total_amount - v_delta
    WHERE order_id = OLD.order_id;
  END IF;

  RETURN NULL;
END;
$$;


