    SELECT branch_id
    INTO v_branch_id
    FROM app.users
    WHERE user_id = p_user_id;

    IF v_branch_id IS NULL THEN
        RAISE EXCEPTION 'Пользователь с id % не найден или не привязан к филиалу (branch_id IS NULL)', p_user_id;
    END IF;

    -- Устанавливаем контекст безопасности для текущей сессии
    -- SET LOCAL через третий параметр = true
    PERFORM set_config('app.current_user_id', p_user_id::text, false);
