--
-- Name: set_session_ctx(integer, integer); Type: FUNCTION; Schema: app; Owner: -
--

CREATE FUNCTION app.set_session_ctx(p_branch_id integer, p_user_id integer) RETURNS void
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    v_exists BOOLEAN;
BEGIN
    -- 1. Проверка, что филиал существует
    SELECT TRUE INTO v_exists
    FROM ref.branches
    WHERE branch_id = p_branch_id;

    IF NOT v_exists THEN
        RAISE EXCEPTION 'Филиал % не существует', p_branch_id;
    END IF;

    -- 2. Проверка, что пользователь существует и относится к филиалу
    SELECT TRUE INTO v_exists
    FROM app.users
    WHERE user_id = p_user_id
      AND branch_id = p_branch_id;

    IF NOT v_exists THEN
        RAISE EXCEPTION 'Пользователь % не принадлежит филиалу %', p_user_id, p_branch_id;
    END IF;

    -- 3. Устанавливаем GUC: контекст филиала и пользователя
    PERFORM set_config('app.current_branch_id', p_branch_id::text, false);
    PERFORM set_config('app.current_user_id',   p_user_id::text, false);
END;
$$;


