CREATE FUNCTION app.trg_orders_set_branch() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Если branch_id не указан явно — берём из пользователя created_by
    IF NEW.branch_id IS NULL AND NEW.created_by IS NOT NULL THEN
        SELECT u.branch_id INTO NEW.branch_id
        FROM app.users u
        WHERE u.user_id = NEW.created_by;
    END IF;

    RETURN NEW;
END;
$$;


