--
-- Name: backup_audit_logs(integer); Type: FUNCTION; Schema: audit; Owner: -
--

CREATE FUNCTION audit.backup_audit_logs(days_interval integer) RETURNS integer
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    v_cutoff TIMESTAMPTZ;
    v_count  INT;
BEGIN
    IF days_interval IS NULL OR days_interval <= 0 THEN
        RAISE EXCEPTION 'Интервал должен быть положительным';
    END IF;

    v_cutoff := now() - (days_interval || ' days')::interval;

    -- Переносим старые записи в архив
        table_name, operation, old_row, new_row,
        username, log_time
    )
    SELECT 
        table_name,
        operation,
        old_row,
        new_row,
        username,
        log_time
    FROM audit.row_change_log
    WHERE log_time < v_cutoff;

    GET DIAGNOSTICS v_count = ROW_COUNT;

    -- Удаляем из основной таблицы
    DELETE FROM audit.row_change_log
    WHERE log_time < v_cutoff;

    RETURN v_count;
END;
$$;


