--

CREATE FUNCTION audit.check_temp_privilege(operation_name text) RETURNS boolean
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'audit'
    AS $$
DECLARE
    privilege_record RECORD;
BEGIN
    SELECT *
    INTO privilege_record
    FROM audit.temp_access_log
    WHERE caller_role = current_user
      AND operation = operation_name
      AND expires_at > now()
      AND is_active = TRUE
    ORDER BY request_time DESC
    LIMIT 1;

    RETURN FOUND;
END;
$$;


