CREATE FUNCTION audit.log_dml() RETURNS trigger
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'audit', 'public'
    AS $$
DECLARE
    v_user VARCHAR(100) := current_user;
BEGIN
    IF (TG_OP = 'INSERT') THEN
        VALUES (v_user, TG_TABLE_SCHEMA||'.'||TG_TABLE_NAME, TG_OP, to_jsonb(NEW));
        RETURN NEW;
    ELSIF (TG_OP = 'UPDATE') THEN
        VALUES (v_user, TG_TABLE_SCHEMA||'.'||TG_TABLE_NAME, TG_OP, to_jsonb(OLD), to_jsonb(NEW));
        RETURN NEW;
    ELSIF (TG_OP = 'DELETE') THEN
        VALUES (v_user, TG_TABLE_SCHEMA||'.'||TG_TABLE_NAME, TG_OP, to_jsonb(OLD));
        RETURN OLD;
    END IF;
    RETURN NULL;
END;
$$;


--
-- Name: log_row_change(); Type: FUNCTION; Schema: audit; Owner: -
--

CREATE FUNCTION audit.log_row_change() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_user TEXT := current_user;
    v_old JSONB;
    v_new JSONB;
BEGIN
    -- маскировка для чувствительных полей (email, phone)
    IF TG_OP = 'UPDATE' THEN
        v_old := to_jsonb(OLD);
        v_new := to_jsonb(NEW);

        -- маскируем клиентские данные, если есть
        IF TG_TABLE_NAME = 'customers' THEN
            v_old := v_old || jsonb_build_object(
                'phone', '[masked]',
                'email', '[masked]'
            );
            v_new := v_new || jsonb_build_object(
                'phone', '[masked]',
                'email', '[masked]'
            );
        END IF;

        VALUES (v_user, TG_TABLE_SCHEMA||'.'||TG_TABLE_NAME, TG_OP, v_old, v_new);

        RETURN NEW;

    ELSIF TG_OP = 'DELETE' THEN
        v_old := to_jsonb(OLD);

        IF TG_TABLE_NAME = 'customers' THEN
            v_old := v_old || jsonb_build_object(
                'phone', '[masked]',
                'email', '[masked]'
            );
        END IF;

        VALUES (v_user, TG_TABLE_SCHEMA||'.'||TG_TABLE_NAME, TG_OP, v_old);

        RETURN OLD;
    END IF;

    RETURN NULL;
END;
$$;


--
-- Name: request_temp_privilege(text, integer); Type: FUNCTION; Schema: audit; Owner: -
--

CREATE FUNCTION audit.request_temp_privilege(operation_name text, duration_min integer) RETURNS text
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'app', 'audit', 'ref'
    AS $$
DECLARE
    expires_time TIMESTAMPTZ;
    allowed_operations TEXT[] := ARRAY['delete_user'];
    is_writer BOOLEAN;
BEGIN
    -- Проверяем, является ли пользователь членом r_app_writer
    SELECT pg_has_role(current_user, 'r_app_writer', 'member')
    INTO is_writer;

    IF NOT is_writer THEN
        RETURN 'Ошибка: функция доступна только для роли r_app_writer. Текущий пользователь: ' || current_user;
    END IF;

    -- Проверяем, разрешена ли операция
    IF operation_name != ALL(allowed_operations) THEN
        RETURN 'Ошибка: операция ' || operation_name || ' не разрешена для временного доступа';
    END IF;

    -- Проверяем длительность
    IF duration_min <= 0 OR duration_min > 1440 THEN
        RETURN 'Ошибка: длительность должна быть от 1 до 1440 минут';
    END IF;

    -- Время истечения привилегии
    expires_time := now() + (duration_min || ' minutes')::INTERVAL;

    -- Записываем запрос
    VALUES (current_user, operation_name, expires_time);

    RETURN 'Временная привилегия на операцию ''' || operation_name ||
           ''' активна до ' || to_char(expires_time, 'YYYY-MM-DD HH24:MI:SS');
END;
$$;


--
-- Name: safe_delete_user_final(integer); Type: FUNCTION; Schema: audit; Owner: -
--

CREATE FUNCTION audit.safe_delete_user_final(target_user_id integer) RETURNS text
    LANGUAGE plpgsql
    AS $$
DECLARE
    user_username TEXT;
BEGIN
    -- Проверка временной привилегии
    IF NOT audit.check_temp_privilege('delete_user') THEN
        RETURN 'Ошибка: отсутствует активная временная привилегия на удаление пользователя';
    END IF;

    -- Проверяем существование
    SELECT username INTO user_username
    FROM app.users
    WHERE user_id = target_user_id;

    IF user_username IS NULL THEN
        RETURN 'Ошибка: пользователь не найден';
    END IF;

    -- Пытаемся удалить
    BEGIN
        DELETE FROM app.users WHERE user_id = target_user_id;
        RETURN 'Пользователь "' || user_username || '" успешно удалён';
    EXCEPTION
        WHEN foreign_key_violation THEN
            RETURN 'Ошибка: существуют связанные записи. Удаление невозможно.';
        WHEN OTHERS THEN
            RETURN 'Ошибка: ' || SQLERRM;
    END;
END;
$$;


