    created_at timestamp with time zone DEFAULT now() NOT NULL,
    branch_id integer,
    CONSTRAINT customers_email_check CHECK (((email)::text ~* '^[A-Z0-9._%+\-]+@[A-Z0-9.\-]+\.[A-Z]{2,}$'::text)),
