--
-- Name: v_branch_orders_stats; Type: VIEW; Schema: app; Owner: -
--

CREATE VIEW app.v_branch_orders_stats WITH (security_barrier='true') AS
 SELECT o.branch_id,
    b.branch_name,
    s.status_name,
    count(DISTINCT o.order_id) AS orders_cnt,
    sum(o.total_amount) AS total_amount
   FROM ((app.orders o
     JOIN ref.branches b ON ((b.branch_id = o.branch_id)))
     JOIN ref.delivery_status s ON ((s.status_id = o.delivery_status_id)))
  GROUP BY o.branch_id, b.branch_name, s.status_name;


--
-- Name: v_users_safe; Type: VIEW; Schema: app; Owner: -
--

CREATE VIEW app.v_users_safe AS
 SELECT user_id,
    username,
    full_name,
    branch_id,
    app_role,
    created_at
   FROM app.users u
  WHERE (branch_id IS NOT NULL)
  WITH LOCAL CHECK OPTION;


